import math

def is_prime(num):
    if num <= 2:
        return False
    for i in range(2, math.isqrt(num) + 1):
        if num % i == 0:
            return False
    return True

def find_third_largest_prime(arr):
    prime_numbers = [num for num in arr if is_prime(num)]
    return -1 if len(prime_numbers) < 3 else sorted(prime_numbers, reverse=True)[2]

